function sum(nodes) {
  var ret = Number(0);
  for( i = 0; i < nodes.size(); i++ ) {
    if( !isNaN( nodes.get(i).getValue() ) ) {
    	ret += Number( nodes.get(i).getValue() );
    }
  }
  target.setValue( ret );
}

function calcCenaticAffinityRisk( r, id_lic, id_eq_lic, id_comp_lic, id_types ) {

  if( isNaN(r.getSource(id_lic).getValue()) ) return;
  if( isNaN(r.getSource(id_eq_lic).getValue()) ) return;
  if( isNaN(r.getSource(id_comp_lic).getValue()) ) return;
  if( isNaN(r.getSource(id_types).getValue()) ) return;

  var n_of_lic = Number(r.getSource(id_lic).getValue());
  var n_of_eq_lic = Number(r.getSource(id_eq_lic).getValue());
  var n_of_comp_lic = Number(r.getSource(id_comp_lic).getValue());
  var n_of_lic_ty = Number(r.getSource(id_types).getValue());

  var n1 = Number(n_of_eq_lic) / Number(n_of_lic);
  var n2 = Number(n_of_comp_lic) / Number(n_of_lic);
  var n3_1 = (Number(n_of_lic_ty) + Number(1));
  var n3_2 = (n3_1 / Number(n_of_lic)) * 100;
  var n3 = (1 / n3_2 );

  var r = 1 - ( Number(n1) + Number( n2 * n3) );

  target.setValue( r );

}

function atLeastOne( sources ) {
  for( i = 0; i < sources.size(); i++ ) {
    if( sources.get(i).getPositive() > 0 ) {
    	  return fx.e( 1, 0 );
      }
    }
  return fx.e( 0, 0 );
}

function maxVal( sources ) {
  var max_val = 0;
  for( i = 0; i < sources.size(); i++ ) {
    if( sources.get(i).getPositive() > max_val ) {
        max_val = sources.get(i).getPositive();
      }
    }
  return fx.e( max_val, 0 );
}

function nonZeros( nodes ) {
  var ret = Number(0);
  for( i = 0; i < nodes.size(); i++ ) {
    if( nodes.get(i).getValue() > 0 ) {
      ret += Number(1);
    }
  }
  target.setValue(ret);
}

function diff(r,id1,id2) {
  target.setValue( Number(r.getSource(id1).getValue()) - Number(r.getSource(id2).getValue()) );
}

function max(nodes) {
  var ret = Number(0);
  for( i = 0; i < nodes.size(); i++ ) {
    if( nodes.get(i).getValue() > ret ) {
      ret = nodes.get(i).getValue();
    }
  }
  target.setValue(ret);
}

function trigger(r,id_counter,id_trigger) {
  if( isNaN(r.getSource(id_trigger).getValue()) ) return;
  if( Number(r.getSource(id_trigger).getValue()) < 1 ) {
    target.setValue(0);
  }
  else {
    target.setValue( Number( r.getSource(id_counter).getValue() ) );
  }
}
function calcMax(r) {
  var max = 0;
  var i = 0;
  for( i = 0; i < r.getSources().size(); i++ ) {
    if( r.getSources().get(i).getValue() > max )
    max = r.getSources().get(i).getValue();
  }
  r.getTarget().setValue(Number(max));
}

function calcNormalizedPerc(r,id) {
  var perc = r.getSource(id).getValue();
  var max = r.getSource("max-perc").getValue();
  var ret = Number(perc)/Number(max);
  r.getTarget().setValue(ret);
}

function calcTrendingFactor(r,id) {
  var total = r.getSource("#licenses").getValue();
  var num = r.getSource("#count:"+id).getValue();
  var norm = r.getSource("normalizedPerc"+id).getValue();
  var ret = (Number(norm)*Number(num))/Number(total);
  r.getTarget().setValue(ret);
}

function calcTrendingTargetFactor(r,id) {
	  var total = r.getSource("#target-licenses").getValue();
	  var num = r.getSource("#target:"+id).getValue();
	  var norm = r.getSource("normalizedPerc"+id).getValue();
	  var ret = (Number(norm)*Number(num))/Number(total);
	  r.getTarget().setValue(ret);
	}

function calcDCLI(r) {
  var sum = Number(0);
  var t = Number(0);
  for( i = 0; i < r.getSources().size(); i++ ) {
    t = Number(r.getSources().get(i).getValue());
    if( !isNaN(t) ) {
    	if( isFinite(t) ) {
    		sum = Number(sum) + Number(t);
    	}
    }
  }
  if( isNaN(sum) ) return;
  var res = 1 - Number(sum);
  if( res == 1 ) res = 0;
  r.getTarget().setValue(res);
}

function calcSum(r) {
  var s = Number(0);
  var i;
  for( i = 0; i < r.getSources().size(); i++ ) {
    if( !isNaN(r.getSources().get(i).getValue() ) ) {
      s += Number(r.getSources().get(i).getValue());
    }
  }
  r.getTarget().setValue(s);
}

function avg(r) {
	var e = 0;
	for( i = 0; i < r.getSources().size(); i++ ) {
		var n = r.getSources().get(i).getValue();
		if( !isNaN(n) ) {
			if( isFinite(n) ) {
				e += n;
			}
		}
	}
	e = e / r.getSources().size();
	target.setValue(e);
//	return fx.e(e,0);
}

function divide(r,id1,id2) {
	target.setValue( Number(r.getSource(id1).getValue()) / Number(r.getSource(id2).getValue()) );
}
